import Menu from './Menu';
import Favourites from './favourites';
import Hero from './hero';
import Special from './special';
import Testimonials from './testimonials';

function App() {
  return (
    <div className="App">

       <Menu />,
       <Hero />,
       <Favourites />, 
       <Special/>,
       <Testimonials/>
      

    </div>
  );
}

export default App;
